import React from 'react';

function HomeInfo(){
	return(
		<header>
			<h3 className = "paragraph">
				We are aiming to take the stress away from Disneyland visitors and help them plan their visits more efficiently according to ride wait times and park population.
				There is nothing worse than getting to the entrance of the park or the line for your favorite ride and realizing that you will be standing around for upwards of an hour. 
				By using our tools, you will maximize every Magic Minute in the Happiest Place on Earth! 
			</h3>
		</header>
	)
}

export default HomeInfo
